All life below the surface serves a purpose. The health of our ocean is the health of our planet. 🦈🐠🐡 Read below for wisdom from #GoProFamily member @oceanramsey 

"Sharks are like the doctors of the ocean—crucial for the health of marine life, ecosystems, + future populations. They keep fish stocks healthy by picking off the sick, weak, + dying—preventing disease from spreading + leaving  resources for the strongest to be able to reproduce. They also help keep coral reefs + sea grass beds healthy, while moving vital nutrients throughout their environment. With this keystone species spiraling towards extinction, we ask that you help save the sharks by raising awareness for their importance + their plight.

